                      FROM "products"
                      JOIN "reviews" ON "products"."DocumentID" == "reviews"."product_id" JOIN "users" ON "reviews"."user_id" == "users"."DocumentID" WHERE (("products"."rating" >= 4) AND ("reviews"."rating" >= 3)) ORDER BY "products.rating" DESC LIMIT 50;

